import React from 'react'
import './style.css'


function Footer() {

    return (
        <div>
        <header className="footer p-2 fixed-buttom footer">
          <div className="row">
            <div className="col-lg text-center">
              <h1 className="text">Footer</h1>
            </div>
          </div>
        </header>
      </div>
    )
}

export default Footer;
